members.member:
            Father's Place Of Birth.
            Mother's Place Of Birth. A Dictionary representing birthplace location, containing the following key/value pairs:

"addressState" - address, state

"addressCountry" - address, country



// Setter:

Dictionary<string, string> address = new Dictionary<string, string>();

address.Add("addressState", "MA");

address.Add("addressCountry", "US");

ExampleBirthRecord.FatherPlaceOfBirth = address;

// Getter:

Console.WriteLine($"State where father was born: {ExampleBirthRecord.FatherPlaceOfBirth["placeOfBirthState"]}");

